script: |
  super -f text -I q3235.spq | sort > q3235.out

inputs:
  - name: q3235.spq
    data: |
      SELECT - 61 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT + - col2 + - 66 BETWEEN + col1 / + - col1 AND - col2;
  - name: tab1

outputs:
  - name: q3235.out
    data: |
      -61
      -61
      -61
